'use strict';

requirejs.config(requirejsConfig);

requirejs(['messenger'],
  function (messenger) {

    var testSaveActivated = function () {
      chrome.tabs.getSelected(null, function (tab){
        if (!tab) return;

        chrome.tabs.sendMessage(tab.id, {
          data: {
            event: 'clipper-activated',
            url: tab.url,
            title: tab.title,
            imgDataUrl: 'data:image/jpeg;base64,',
            nativeWidth: tab.width,
            nativeHeight: tab.height
          }
        });
      });

    };

    messenger.registerEvent('test:clipper-activated', testSaveActivated);
  });
